import state from './redux/state';


const leftBarPage = [

	brand = {

	 binomo: { 

		 id : 'binomo',
		 label : 'Binomo',
		 book : '',
		 creatives : '',
		 googleplay : '',
		 appstor : '',
		 site : '',
		 figma : '',
		 recommend : ''

		 } ,

		 octafx:  {

			 id : 'octafx',
