			 site : '',
			 figma : '',
			 recommend : ''

		 }
	 }
 ]



const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <App  leftBar = {leftBarPage} />
  </React.StrictMode>
);





